import { Link } from "react-router-dom";

export default function Card ({name,image,continent}){
    return (
        <div>
            <img src={image} alt="img not found" width="200px" height="250px" />
            <h3>{name}</h3>
            <h5>{continent}</h5>
            <Link to= "/Detail">Detail</Link>
        </div>
    )
}
